import React from 'react';
import { StyleSheet } from 'react-native';

const Styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',

      margin: 5,
    },

    boldText25:{
        fontWeight: 'bold',

    }, 
    horizontal_align:{
        flexDirection: 'row',
        alignItems:'center'
    },
    text: {
      height: 40,
      fontSize: 25,
      textAlign: 'left',
    },

    largeTitle: {
      fontSize: 15,
      fontWeight: 'bold',
      color: 'red',
    },

    input: {
      height: 40,
      width: '100%',

      borderTopWidth: 1,
      borderBottomWidth: 2,
    }

  });

  export default Styles;
